import Button from "./button.js"



function App() {
  return (
    <>
      <main className= "container">
        <img src = "C:\Users\Karlangas\Documents\GitHub\sign-up-form\sign-up-form\public\DibujoNico.jpg" alt ="Painting that covers the whole left side" className="left"></img>

        <div className ="right">This could be your business
          <header className= "header"></header>
          <details className = {Details}>1-6 inputs</details>
          <button></button>
        </div>
      </main>
    </>
  );
}

export default App;
